DNA = ''

contadorNucleotideos = {}


for nucleotideo in DNA.strip():
    if nucleotideo not in contadorNucleotideos:
        contadorNucleotideos[nucleotideo] = 1
    else:contadorNucleotideos[nucleotideo] += 1

